import { useState, useEffect } from 'react';
const Client = () => {
  const [datas, setDatas] = useState([
    { id: 1, title: '글1' },
    { id: 2, title: '글2' },
    { id: 3, title: '글3' },
    ,
    { id: 4, title: '글4' },
  ]);

  useEffect(() => {
    fetch('http://localhost:4000/api/data')
      .then((response) => response.json())
      .then((content) => setDatas(content));
  }, []);
  return (
    <div>
      <h2>임시</h2>
      {datas.map((data) => {
        <div key={data.id}>
          <div>{data.id}</div>
          <div>{data.title}</div>
        </div>;
      })}
    </div>
  );
};
export default Client;
